import { Link } from "react-router-dom";
import React, { useContext } from "react";
import { useNavigate } from "react-router-dom";
import { AuthContext } from "../contex/Authenticate";
import axios from "axios";
import '../style/Navbar.scss'

const Navbar = () => {
  const navegate = useNavigate();
  const { toggleAuth, isAuthenticated, name } = useContext(AuthContext);

  const logOut = () => {
    toggleAuth();
    axios
      .post("http://localhost:1337/api/users/logout")
      .then((res) => {
        localStorage.removeItem("name", JSON.stringify(res.data));
      })
      .then(() => navegate("/login"));
  };

  return (
    <nav className="navbar">
      <ul className="content">
        <li>
          {" "}
          <Link to={"/perfiluser"}>{name}</Link>
        </li>
        <li>
          <a href="/" class="activo" className="moviesmaxs">
            MoviesMaxs
          </a>{" "}
        </li>
        <li>
            <a href="/search">Search</a>
        </li>
        <li>
          <Link to="/register">
            <a className="register">Register</a>
          </Link>
        </li>
        <li>
          {" "}
          {!isAuthenticated ? (
            <Link to="/login">
              <a className="login">Login</a>
            </Link>
          ) : (
            <Link to="/">
              <a className="login" onClick={logOut}>
                Logout
              </a>
            </Link>
          )}
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
